import { View, Text } from 'react-native'
import React from 'react'
import tw from "twrnc";

export default function Principal() {
    return (
        <View style={tw`bg-slate-50 justify-center items-center h-full`}>
            <box flex="{1}" alignitems="center">
                <Text>Principal</Text>
            </box>
        </View>
    )
}
